import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import './adminsidebar.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// import '../css/Common.css';
// import '../css/Dashboard.css';
// import {withTracker}        from 'meteor/react-meteor-data';

export default class Sidebar extends Component{
    constructor(props){
        super(props);
        this.state = {
          menuValues : {
            contactManagement     : false,
            dealManagement        : false,
            visitorsmanagement    : false,
            userManagement        : false,
            notification          : false,
            masterData            : false,
          }
        };
        this.closeIcon   = 'fa-plus';
        this.openIcon    = 'fa-minus';
      }

  componentWillMount(){

  }
   componentDidMount(){
    // Meteor.call("LoginUserRole",Meteor.userId(),(err,res)=>{
    //   if(err){
    //     console.log(err);
    //   }else{
    //     if(res[0]=="admin"){
    //       this.setState({
    //         loginuserRole : res[1]
    //       },()=>{this.getadminLTE()});
    //     }
    //   }
    // });
    this.getadminLTE();
  }

  getadminLTE(){
      if ($('body').hasClass('adminLte')) {
        var adminLte = document.createElement("script");
        adminLte.type="text/javascript";
        adminLte.src = "/js/adminLte.js";
        $("body").append(adminLte);
      }
  }

  componentWillUnmount(){
    $("script[src='/js/adminLte.js']").remove();
    $("link[href='/css/dashboard.css']").remove();
  }

  removePersistantSessions(){
      // UserSession.delete("progressbarSession", Meteor.userId());
      // UserSession.delete("allProgressbarSession", Meteor.userId());
  }

  currentUser(){
    // var LoginUserData = Meteor.users.findOne({"_id":Meteor.userId()});
    // if(LoginUserData){
    //   var profile = LoginUserData.profile;
    //   if(profile){
    //     var firstName = profile.firstname;
    //   }
    //   return firstName;
    // }

  }

  openMenu = (key) => {
    let {menuValues} = this.state;
    Object.keys(menuValues).map((data) => {
      menuValues[data] = (data==key) ? !menuValues[key] :false;
    });
    this.setState({menuValues});
  }

  render(){
    let {contactManagement,dealManagement,visitorsmanagement,userManagement,notification,masterData} = this.state.menuValues;
    return(

        <aside className="main-sidebar" onClick={this.removePersistantSessions.bind(this)}>
          <section className="sidebar">


            <ul className="sidebar-menu" data-widget="tree">
              {/* <li className="">
                <Link className="reactRouterlist bgclr" to="/adminDashboard" activeClassName="active">
